var generateData = function (template, rows) {
    if (!template) return null;
    var data = [], row, i, j = template.length;
    for (var i = 0; i < rows; i++) {
        row = template[i % j];
        var row2 = {};
        if(typeof($) != "undefined") $.extend(row2, row);
        else row2 = window.extend(row2, row);
        row2.name = row2.name + i;
        data[i] = row2;
    }
    return data;
}

