function menuRedirect(section){
    var page, id, current, t, i;
    if (section.indexOf("#") < 0) return;
    page = section.split("#")[0];
    id = section.split("#")[1];
    current = location.pathname;
    if (current.indexOf("/" + page) >= 0) {
        showSection(id);
        /*t = document.getElementsByClassName("nav-uls");
        for (i = 0; i < t.length; t++) t[i].style.visibility = "hidden";
        t = document.getElementsByClassName("nav-ulsback");
        for (i = 0; i < t.length; t++) t[i].style.visibility = "hidden";*/
        t = document.getElementsByClassName("nav")[0];
        if (t) t.className = "nav hide";
        setTimeout(function(){t.className = "nav";}, 100);
    }
    else
        location.href = getRootPath() + "/" + page;

}

function getId(){
    var request = location.search, id, s = request.indexOf("id="), e;
    if (s < 0) return;
    id = request.substr(s);
    e = id.indexOf("&");
    if (e >= 0) return id.substr(0, e);
    else return id;
}

function showSection(id){
    if (id == undefined) id = getId();
    if (id == undefined) return;
    var current = document.getElementsByClassName("section_show")[0], target = document.getElementById(id);
    if (current) current.className = "section";
    if (target) target.className = "section section_show";
}